package com.ufgov.zc.common.system.model;import java.io.Serializable;public class AsTabCol implements Serializable {  private String tabId;  private String dataItem;  private String dataItemDesc;  private String dataItemNa;  private String dataType;  private String isOrder;  public String getTabId() {    return tabId;  }  public void setTabId(String tabId) {    this.tabId = tabId;  }  public String getDataItem() {    return dataItem;  }  public void setDataItem(String dataItem) {    this.dataItem = dataItem;  }  public String getDataItemDesc() {    return dataItemDesc;  }  public void setDataItemDesc(String dataItemDesc) {    this.dataItemDesc = dataItemDesc;  }  public String getDataItemNa() {    return dataItemNa;  }  public void setDataItemNa(String dataItemNa) {    this.dataItemNa = dataItemNa;  }  public String getDataType() {    return dataType;  }  public void setDataType(String dataType) {    this.dataType = dataType;  }  public String getIsOrder() {    return isOrder;  }  public void setIsOrder(String isOrder) {    this.isOrder = isOrder;  }  public String toString() {    return dataItemNa;  }}